import React from 'react';
import { 
    getEmploye , 
    useEmployeContext,
    useEmployeDispatchContext
  } from '../../contexts/employeContext';


const Employe = () => {

    const dispatch = useEmployeDispatchContext(); 
    const state = useEmployeContext();

    React.useEffect(() => {
        getEmploye(dispatch);
    },[])

    return (
        <div className="main">
           <div className="card-container">
             { state.length ? state.map( employe => (
                 <div className="card">
                 <div className="card-header">
                     <h1 className="card-title"> title de la card </h1>
                 </div>
                 <div className="card-body">
                     <p> le corp de la card </p>
                 </div>
                 <div className="card-footer">
                     footer de la card
                 </div>
         </div>
             )): ( <h2> la list est vide </h2>)}
           </div>
        </div>
    )
}


export default Employe;
